import React from "react";
import { Link } from "react-router-dom";

export default function Home() {
  return (
    <div className="text-center p-10">
      <h1 className="text-4xl font-bold mb-4">Welcome to the National Museum</h1>
      <p className="text-lg mb-8">Explore centuries of history and art. Book your tickets with our chatbot.</p>
      <Link to="/chatbot" className="bg-blue-500 text-white px-6 py-3 rounded-full font-semibold">
        Book Tickets Now
      </Link>
    </div>
  );
}
